ght. Front-matter’s pages are numbered with Roman numerals'=>'Números de página en la esquina inferior derecha y títulos de artículos en la parte superior derecha. Las páginas de front-matter están numeradas con números romanos','Each article begins on a new page'=>'Cada artículo comienza en una nueva página','Back matter uses your large company logo with background color'=>'La materia posterior utiliza el logotipo de su gran empresa con color de fondo','Very similar to Print My Blog Quick Print, but supporting Pro features. Great for making a PDF for an easy-to-read digital backup of your favorite website content.'=>'Muy similar a Print My Blog impresión rápida, pero compatible con las características Pro. Ideal para hacer un PDF para una copia de seguridad digital fácil de leer de su contenido favorito del sitio web.','External hyperlinks (links to web pages not in the project) can be automatically converted to footnotes, left in-place, or removed'=>'Los hipervínculos externos (enlaces a páginas web que no están en el proyecto) se pueden convertir automáticamente en notas al pie, dejarse in situ o eliminarse','Footnotes only work with Pro'=>'Las notas al pie de página solo funcionan con Pro','Internal hyperlinks (links to content included in the project) can be automatically converted to to footnotes, inline page references, left in-place, or removed'=>'Los hipervínculos internos (vínculos al contenido incluido en el proyecto) se pueden convertir automáticamente en notas al pie, referencias de página en línea, dejar en su lugar o eliminarse','Footnotes and page references only work with Pro PDF Service'=>'Las notas al pie y las referencias de página solo funcionan con Pro Print Service','Limit image size by setting maximum height'=>'Limite el tamaño de la imagen estableciendo la altura máxima','Optionally automatically center images'=>'Opcionalmente, centrar automáticamente las imágenes','Optionally float images to the top or bottom of each page'=>'Opcionalmente, flote imágenes en la parte superior o inferior de cada página','Page numbers in bottom-right corner, article titles in the top-right, and part titles (if using parts) appear in the top-left corner. Front-matter’s pages are numbered with Roman numerals'=>'Los números de página en la esquina inferior derecha, los títulos de artículos en la parte superior derecha y los títulos de pieza (si usan piezas) aparecen en la esquina superior izquierda. Las páginas de front-matter están numeradas con números romanos','Most browsers add their own content to the page margins'=>'La mayoría de los navegadores añaden su propio contenido a los márgenes de página','Each article can optionally begin on a new page'=>'Cada artículo puede comenzar opcionalmente en una nueva página','Designed to look good when viewed from a device or printing to paper. The two-column layout leads to more compact content, especially good if your content doesn’t require the full page width'=>'Diseñado para verse bien cuando se ve desde un dispositivo o impresión al papel. El diseño de dos columnas conduce a contenido más compacto, especialmente bueno si su contenido no requiere el ancho completo de la página','Most browsers will only print a white background'=>'La mayoría de los navegadores solo imprimirán un fondo blanco','Main matter is divided into two columns, while front matter uses the full page width.'=>'La materia principal se divide en dos columnas, mientras que la materia frontal utiliza el ancho de página completo.','Some browsers don‘t support multiple columns'=>'Algunos navegadores no admiten varias columnas','Content can be divided into parts with a special part opening area using the full page width.'=>'El contenido se puede dividir en piezas con un área de apertura de pieza especial utilizando el ancho de página completo.','The title page can include a title and preamble. Other content can immediately follow, without needing a page break.'=>'La página de título puede incluir un título y un preámbulo. Otro contenido puede seguir inmediatamente, sin necesidad de un salto de página.','Each article includes just its title and content, and an optional dividing line to help distinguish between articles.'=>'Cada artículo incluye solo su título y contenido, y una línea divisoria opcional para ayudar a distinguir entre artículos.','If your content is already divided into columns, optionally automatically remove them to improve the layout.'=>'Si el contenido ya está dividido en columnas, opcionalmente los quita automáticamente para mejorar el diseño.','Optionally begin each post on a new page, or be shown immediately following the previous one.'=>'Opcionalmente, comience cada publicación en una nueva página o se mostrará inmediatamente después de la anterior.','Optionally have each article title take up the full page width, or show them inside columns.'=>'Opcionalmente, pida a cada título del artículo que tome el ancho completo de la página o que los muestre dentro de las columnas.','Internal links (hyperlinks to content included in the project) are replaced with page references.'=>'Los vínculos internos (hipervínculos al contenido incluido en el proyecto) se reemplazan por referencias de página.','External links (hyperlinks to content on the internet) are left as-is.'=>'Los enlaces externos (hipervínculos al contenido en Internet) se dejan tal cual.','Most content is divided between two columns.'=>'La mayor parte del contenido se divide en dos columnas.','Page numbers in bottom-right corner, and part titles in the top-left. Front-matter’s pages are numbered with Roman numerals'=>'Números de página en la esquina inferior derecha y títulos de pieza en la parte superior izquierda. Las páginas de front-matter están numeradas con números romanos','Special Instructions'=>'Instrucciones especiales','Front matter defaults to using the full page width. To force something to be divided into columns, add the CSS class "mayer-columns" inside your content.'=>'El valor predeterminado de la materia frontal es usar el ancho de página completo. Para forzar que algo se divida en columnas, agregue la clase CSS "mayer-columns" dentro de su contenido.','Very similar to Print My Blog Quick Print, but supporting Pro features. Great for printing your WordPress content.'=>'Muy similar a Imprimir mi blog gratis, pero compatible con las características Pro. Ideal para imprimir su contenido de WordPress.','For creating a printout of your WordPress content that saves paper and ink.'=>'Para crear una impresión de su contenido de WordPress que guarda papel y tinta.','This design uses a smaller font, small images, doesn’t add pagebreaks between articles, and avoids unnecessary extra information.'=>'Este diseño utiliza una fuente más pequeña, imágenes pequeñas, no agrega saltos de página entre artículos y evita información adicional innecesaria.','Perfect for editing and reviewing your content! Compact to conserve paper, lots of meta-information, and double-spaced text to allow for editor’s notes.'=>'¡Perfecto para editar y revisar tu contenido! Compacto para conservar papel, mucha meta-información y texto espaciado doble para permitir las notas del editor.','External hyperlinks (links to web pages not in the project) can be automatically converted to footnotes or removed'=>'Los hipervínculos externos (enlaces a páginas web que no están en el proyecto) se pueden convertir automáticamente en notas al pie o eliminarse','Footnotes require Pro'=>'Las notas al pie de página requieren Pro','Internal hyperlinks (links to content included in the project) can be automatically converted to footnotes, inline page references, or removed'=>'Los hipervínculos internos (vínculos al contenido incluido en el proyecto) se pueden convertir automáticamente en notas al pie, referencias de página en línea o eliminarse','Footnotes and page references require Pro PDF Service'=>'Las notas al pie y las referencias a páginas requieren pro print service','This design is meant for printing on both sides of the page so you see two pages at once (the "page spread"). So the left-hand page will be styled differently than the right-hand page.'=>'Este diseño está diseñado para imprimir en ambos lados de la página para que vea dos páginas a la vez (el "pliego de página"). Así que la página izquierda se estilizará de forma diferente a la página derecha.','Page numbers in bottom-outside corner, part titles appear in the top of the left page, article titles appear at the top of the right page. Front-matter’s pages are numbered with Roman numerals'=>'Los números de página en la esquina inferior exterior, los títulos de parte aparecen en la parte superior de la página izquierda, los títulos de los artículos aparecen en la parte superior de la página derecha. Las páginas de front-matter están numeradas con números romanos','Multi-column newspaper design designed for printing. Wide images can span multiple columns and always snap to the nearest page edge to make a visually-appealing layout.'=>'Diseño de periódico multicolumna diseñado para impresión. Las imágenes anchas pueden abarcar varias columnas y siempre ajustarse al borde de página más cercano para crear un diseño de apariencia visual.','The "Title page" is actually a special header on the front page containing your publication\'s title, issue number, date, and other optional prominent info (set on the design and project meta settings).'=>'La "Página de título" es en realidad un encabezado especial en la página principal que contiene el título de su publicación, el número de edición, la fecha y otra información destacada opcional (establecida en la configuración meta del diseño y el proyecto).','Content is divided into two, three, or four columns.'=>'El contenido se divide en dos, tres o cuatro columnas.','The top margin contains the front page (publication title, issue number, date, etc.).'=>'El margen superior contiene la portada (título de la publicación, número de edición, fecha, etc.).','Designed for duplex printing with the left page mirroring the right page\'s margins.'=>'Diseñado para impresión dúplex con la página izquierda reflejando los márgenes de la página derecha.','Content can be divided into parts. Part openings and important articles\' titles and cover images take up the full page width, whereas regular articles compactly fit into columns.'=>'El contenido se puede dividir en partes. Las aperturas de piezas y los títulos e imágenes de portada de artículos importantes ocupan todo el ancho de página, mientras que los artículos normales encajan de forma compacta en columnas.','Each article may include post title, ID, author, published date, categories and tags, URL, featured image, excerpt, custom fields, and content.'=>'Cada artículo puede incluir: Título, ID, Autor, URL, Fecha publicada, Categorías y etiquetas, Imagen destacada, Extracto, Contenido','Issue and page number are in the outside top margin, the publication\'s title is in the middle top margin, and the publication date is in the inside top margin. The optional publication subtitle is underneath the other top-margin content.'=>'El número y el número de página están en el margen superior exterior, el título de la publicación está en el margen superior medio y la fecha de publicación está en el margen superior interior. El eslogan opcional está debajo del otro contenido del margen superior.','Section Templates'=>'Plantillas de sección','Choose different styles for articles included in your project:'=>'Elija diferentes estilos para los artículos incluidos en su proyecto:','Default Template: shows all content specified by the "Post Content" design setting (e.g. the article\'s title and featured image) in columns.'=>'Plantilla predeterminada: muestra todo el contenido especificado por la configuración de diseño "Contenido de publicación" (por ejemplo, el título del artículo y la imagen destacada) en columnas.','Single Column: like the default template, but in a single column.'=>'Columna única: muestra todo el contenido especificado por la configuración de diseño "Contenido de publicación" en una sola columna.','Fullpage Content: contains only the article\'s content (no title, featured image, etc.) all in a single, wide column.'=>'Contenido de página completa: contiene solo el contenido del artículo (sin título, imagen destacada, etc.) todo en una sola columna ancha.','Full Column Content: like "Fullpage Content", except content is still divided into multiple columns..'=>'Contenido completo de la columna: como "Contenido de página completa", excepto que el contenido todavía está dividido en varias columnas.','Important: shows the article\'s featured image and title across all columns, but other content is shown in multiple columns.'=>'Importante: muestra la imagen destacada y el título del artículo en todas las columnas, pero otro contenido se muestra en varias columnas.','Parts start on a new page and include the part’s title, featured image, and content.'=>'Las piezas comienzan en una página nueva e incluyen el título, la imagen destacada y el contenido de la pieza.','Note that in order to improve page layout, all images and figures snap to the nearest page edge.'=>'Las imágenes de "ancho completo" ocupan todas las columnas y se ajustan al borde de página más cercano.','"Full width" images take up all columns and snap to the nearest page edge.'=>'Las imágenes de "ancho completo" ocupan todas las columnas y se ajustan al borde de página más cercano.','"Wide width" images take up 2 columns and snap to the nearest page edge.'=>'Las imágenes de "ancho ancho" ocupan 2 columnas y se ajustan al borde de página más cercano.','Only works with PMB’s Pro PDF Service.'=>'Solo funciona con %1$sPro PDF Service%2$s','%1$sAdd the CSS class "%2$s"%3$s to any images you don\'t want to snap like this.'=>'%1$s Añade la clase CSS "%2$s"%3$s a cualquier imagen que no quieras ajustar de esta manera.','Issue %s, Page %s'=>'Publicación %s, página %s','Issue %s'=>'Edición %s','Similar to Print My Blog Quick Print\'s other "Classic" designs, except optimized for reading by Microsoft Word. Useful when you need to deliver your content as a Microsoft Word Document (like to an editor), or for using as an intermediate format for delivery to other applications (like for importing into Adobe InDesign).'=>'Similar a los otros diseños "clásicos" de Print My Blog Quick Print, excepto optimizado para la lectura por Microsoft Word. Útil cuando necesite entregar su contenido como un documento de Microsoft Word (como a un editor) o para usarlo como formato intermedio para su entrega a otras aplicaciones (como para importar a Adobe InDesign).','A table of contents is generated and inserted at the requested location. Once in Microsoft Word, right click on the table of contents and click "Update Field"; or press Ctrl + A, then F9.'=>'Se genera una tabla de contenido y se inserta en la ubicación solicitada. Una vez en Microsoft Word, haga clic derecho en la tabla de contenido y haga clic en "Actualizar campo"; o presione Ctrl + A y, a continuación, F9.','Images may be bundled into the Word Document file so they can be used offline or if the website hosting the images goes offline.'=>'Las imágenes se pueden agrupar en el archivo del documento de Word para que se puedan usar sin conexión o si el sitio web que aloja las imágenes se desconecta.','External hyperlinks (links to web pages not in the project) may be left as working hyperlinks or removed'=>'Los hipervínculos externos (enlaces a páginas web que no están en el proyecto) pueden dejarse como hipervínculos en funcionamiento o eliminarse','Internal hyperlinks (links to content included in the project) may be converted into links to the appropriate page of the document, left as hyperlinks to the website, or removed.'=>'Los hipervínculos internos (enlaces al contenido incluido en el proyecto) pueden convertirse en enlaces a la página adecuada del documento, dejarse como hipervínculos al sitio web o eliminarse.','All images are automatically included in the Word Document file (instead of merely pointing to the external image source). This makes the filesize larger, but allows users to view images while disconnected from the Internet.'=>'Todas las imágenes se incluyen automáticamente en el archivo de documento de Word (en lugar de simplemente apuntar a la fuente de imagen externa). Esto hace que el tamaño del archivo sea más grande, pero permite a los usuarios ver imágenes mientras están desconectados de Internet.','Powered by Print My Blog Pro & WordPress'=>'Imprima mi blog ahora gratis','Purchase Required'=>'Compra requerida','Works better with %1$sPro PDF Service%2$s'=>'Funciona mejor con %1$sPro PDF Service%2$s','More Advanced Features in %1$sPro Print%2$s'=>'Características más avanzadas en %1$sPro Print%2$s','Drag the %s "%s" into your project'=>'Arrastre la %s "%s" al proyecto','View "%s"'=>'Ver "%s"','Edit "%s"'=>'Editar “%s”','Replace "%s" with the existing Print Material for customizing.'=>'Reemplace "%s" por el material de impresión existente para personalizarlo.','Replace "%s" with a New Print Material for customizing'=>'Reemplace "%s" por un nuevo material de impresión para personalizar','Upgrade to Professional License for one-click copying to Print Materials for customization.'=>'Actualice a la licencia profesional para copiar con un solo clic a Materiales de impresión para su personalización.','Add "%s" to project'=>'Añadir "%s" al proyecto','Remove "%s"'=>'Quitar "%s"','Drag or click here'=>'Arrastre o haga clic aquí','Post custom field name' . "\4" . '%s:'=>'%s:','We’re sorry, but you have another version of Print My Blog active. Only one can be active at a time. Please deactivate one.'=>'Lo sentimos, pero tienes otra versión de Imprimir mi blog activa. Sólo uno puede estar activo a la vez. Por favor, desactiva uno.','We’re sorry, but Print My Blog requires PHP version %1$s or greater in order to operate. You are currently running version %2$s.%3$sIn order to update your version of PHP, you will need to contact your current hosting provider.%3$sFor information on stable PHP versions, please go to %4$s.'=>'Lo sentimos, pero Imprimir mi blog requiere la versión PHP %1$s o superior para poder operar. Actualmente está ejecutando la versión %2$s. %3$s Para actualizar su versión de PHP, tendrá que ponerse en contacto con su proveedor de alojamiento actual. %3$s Para obtener información sobre las versiones estables de PHP, vaya a %4$s.','We’re sorry, but Print My Blog requires WordPress %1$s. You are using %2$s.%3$sFor information on how to update, please see %4$s.'=>'Lo sentimos, pero Imprimir mi blog requiere %1$s de WordPress. Estás usando %2$s. %3$s Para obtener información sobre cómo actualizar, consulte %4$s.','360 Image Available'=>'Imagen 360 disponible','Language'=>'Idioma','All Languages'=>'Todos los Idiomas','Default language (currently %s)'=>'Idioma predeterminado (actualmente %s)','Translate %s Design'=>'Elija %s Diseño','%s Translations'=>'traducciones %s','Translate Project Metadata'=>'Editar metadatos del proyecto','"%1$s" is fully translated into %2$s'=>'"%1$s" está completamente traducido en %2$s','Print My Blog'=>'Imprimir mi blog','Pro Print'=>'Pro impresión','Print My Blog – Quick Print'=>'Imprimir mi blog – Impresión rápida','Quick Print'=>'Impresión rápida','Print My Blog Designs'=>'Imprimir la configuración de mi blog','Designs'=>'Diseños','Print My Blog Settings'=>'Imprimir la configuración de mi blog','Settings'=>'Ajustes','Help Me Print My Blog'=>'Ayúdame a imprimir mi blog','Help'=>'Ayuda','Keyboard Accessibility'=>'Accesibilidad del teclado','Settings Saved!'=>'¡Ajustes guardados!','You should see the changes on your %1$slatest post%2$s.'=>'Deberías ver los cambios en tu %1$sla última publicación%2$s.','Show print buttons on:'=>'Mostrar botones de impresión en:','Note: you need to upgrade your license to access the following formats: %s'=>'Nota: debe actualizar su licencia para acceder a los siguientes formatos: %s','Print Formats'=>'Formatos de impresión','Email Print My Blog Support'=>'Impresión por correo electrónico Mi blog soporte','Email successfully sent. Expect a reply in the next 1-2 business days.'=>'Correo electrónico enviado correctamente. Espere una respuesta en los próximos 1-2 días hábiles.','There was an error sending an email from your website (it was "%1$s"). Please manually send an email to %2$s, with the subject "%3$s", with the content:'=>'Se ha producido un error al enviar un correo electrónico desde su sitio web (se trata de "%1$s"). Por favor, envíe manualmente un correo electrónico a %2$s, con el asunto "%3$s", con el contenido:','Please explain what you did, what you expected, and what went wrong'=>'Por favor, explique lo que hizo, lo que esperaba, y lo que salió mal','Including links to screenshots is appreciated'=>'Se aprecia incluir enlaces a capturas de pantalla','Your Name'=>'Tu nombre','Are you ok with us viewing your most recent generated documents?'=>'¿Está de acuerdo con que veamos sus documentos generados más recientes?','Viewing your most recent generated documents saves a lot of time figuring out what is going wrong. We won’t share your content with anyone else.'=>'Ver sus documentos generados más recientes ahorra mucho tiempo para averiguar qué está saliendo mal. No compartiremos su contenido con nadie más.','This debug info will also be sent.'=>'Esta información de depuración también se enviará.','This is mostly system information, list of active plugins, active theme, and some Print My Blog Pro info like your most recent projects.'=>'Esta es principalmente información del sistema, lista de plugins activos, tema activo, y alguna información de Print My Blog Pro como sus proyectos más recientes.','Support for your plan is offered on GitHub'=>'El soporte para su plan se ofrece en GitHub','GitHub is a public forum to share your issues with the developer and other users.'=>'GitHub es un foro público para compartir sus problemas con el desarrollador y otros usuarios.','You will need to first %1$screate a GitHub account%2$s. If you prefer to use email support please %3$spurchase a license that offers email support.%2$s'=>'Primero deberá %1$screar una cuenta de GitHub%2$s. Si prefiere utilizar la asistencia por correo electrónico, %3$scompre una licencia que ofrezca asistencia por correo electrónico.%2$s','Delete All Data'=>'Eliminar todos los datos','Please select items to add to the project'=>'Seleccione los elementos que desea agregar al proyecto','Please select items to remove'=>'Selecciona los elementos que deseas eliminar','Please select items to move'=>'Selecciona los elementos que deseas mover','Error inserting. Please use the PMB help page to get help'=>'Error al insertar. Utilice la página de ayuda de PMB para obtener ayuda','Error creating new print material. Please use the PMB help page to get help.'=>'Error al insertar. Utilice la página de ayuda de PMB para obtener ayuda','Your project\'s Body is empty. You may have forgetten to drag items from "Available Content" (on the left) into the "Chosen Project Content"\'s Body (on the right). Are you sure you want to leave your project\'s Body empty?'=>'El cuerpo del proyecto está vacío. Es posible que haya olvidado arrastrar elementos de "Contenido disponible" (a la izquierda) al cuerpo del "Contenido del proyecto elegido" (a la derecha). ¿Está seguro de que desea dejar el cuerpo de su proyecto vacío?','There was an error preparing your content. Please visit the Print My Blog Help page.'=>'Se ha producido un error al preparar el contenido. Visite la página de ayuda imprimir mi blog.','Your project could not be accessed in order to generate the file. Maybe your website is not public? Please visit the Print My Blog Help page.'=>'No se pudo acceder a su proyecto para generar el archivo. ¿Tal vez su sitio web no es público? Visite la página de ayuda imprimir mi blog.','Are you sure you want to duplicate this project?'=>'¿Está seguro de que desea restablecer la configuración de nuevo a los valores predeterminados?','There was an error communicating with Print My Blog Central. It was %s'=>'Se ha producido un error al comunicarme con Print My Blog Central. Fue %s','Design "%s" successfully saved.'=>'Diseño "%s" guardado correctamente.','An invalid design (%1$s) or format provided(%2$s)'=>'Un diseño (%1$s) o formato no válido(%2$s)','%1$s is now the default design the %2$s on all new projects.'=>'%1$s es ahora el diseño predeterminado que el %2$s en todos los proyectos nuevos.','Project Title'=>'Título del proyecto','Format'=>'Formato','Successfully setup the project "%s".'=>'Configure correctamente el proyecto "%s".','You need to choose and customize the design for your %s.'=>'Debe elegir y personalizar el diseño de su %s.','The content in your project has changed'=>'El contenido del proyecto ha cambiado','Updated project content.'=>'Contenido actualizado del proyecto.','You have customized this design'=>'Ha personalizado este diseño','The design "%s" has been customized, and its changes will be reflected in all projects that use it.'=>'El diseño "%s" ha sido personalizado, y sus cambios se reflejarán en todos los proyectos que lo utilizan.','You changed the design'=>'Cambiaste el diseño','You chose the design "%1$s" for the %2$s of your project.'=>'Usted eligió el diseño "%1$s" para el %2$s de su proyecto.','You changed projected metadata'=>'Ha cambiado los metadatos proyectados','Project metadata updated.'=>'Metadatos del proyecto actualizados.','There is no file format with the slug "%s"'=>'No hay ningún formato de archivo con el slug "%s"','Save'=>'Guardar','Project successfully duplicated. It is titled "%1$s".'=>'Proyecto duplicado correctamente. Se titula "%1$s".','Cached external resources and images were cleared.'=>'Se borraron los recursos externos y las imágenes almacenados en caché.','Go to the %1$s "%2$s" was copied from.'=>'Vaya a la %1$s se copió "%2$s".','Go to Original %s'=>'