gina de impresión lista','There was an error fetching posts. It was: '=>'Hubo un error al recuperar publicaciones. Fue: ','No response from WP REST API.'=>'No hay respuesta de WP REST API.','Sorry, There was a Problem 😢'=>'Lo siento, hubo un problema 😢','%1$sRead our FAQs%2$s, then feel free to ask for help in %3$sthe support forum.%2$s'=>'%1$s Lea nuestras preguntas frecuentes%2$s y, a continuación, no dude en pedir ayuda en %3$sel foro de apoyo. %2$s','Comments'=>'Comentarios','No Comments'=>'Sin comentarios','<span class="screen-reader-text says">says:</span>'=>'<span class="screen-reader-text says">Dice:</span>','ID:'=>'ID:','By'=>'Por','Protected:'=>'protegido:','Private:'=>'privado:','Copied! Ready to paste.'=>'¡Copiado! Listo para pegar.','There was an error copying. You can still select all the text manually and copy it.'=>'Se ha producido un error al copiar. Todavía puede seleccionar todo el texto manualmente y copiarlo.','Title'=>'Título','Date'=>'Fecha','Delete'=>'Borrar','Untitled'=>'Sin título','Duplicate'=>'Duplicar','Feature included in Professional and Business licenses'=>'Función incluida en las licencias Professional y Business','Started'=>'Comenzado','%1$s at %2$s'=>'%1$s en %2$s','Y/m/d'=>'Y/m/d','g:i a'=>'g:i a','Click "Add New Project" 👆 To Make Your First Project!'=>'Haga clic en "Añadir nuevo proyecto" 👆 para hacer su primer proyecto!','Classic Print PDf'=>'PDf de impresión clásica','Font Settings'=>'Configuración de fuente','Paragraph Indent'=>'Sangría del párrafo','Indent the first line of each new paragraph instead of adding a paragraph break.'=>'Sangría de la primera línea de cada nuevo párrafo en lugar de agregar un salto de párrafo.','Link, Page Reference, and Footnote Settings'=>'Configuración de enlace, referencia de página y nota al pie','Remove'=>'Eliminar','Replace with page reference'=>'Reemplazar por referencia de página','Replace with footnote'=>'Reemplazar por nota al pie','Internal Hyperlinks'=>'Hipervínculos internos','How to display hyperlinks to content included in this project.'=>'Cómo mostrar hipervínculos al contenido incluido en este proyecto.','External Hyperlinks'=>'Hipervínculos externos','How to display hyperlinks to content not included in this project.'=>'Cómo mostrar hipervínculos en contenido no incluido en este proyecto.','Classic Digital PDF'=>'PDF digital clásico','Buurma Digital PDF'=>'Buurma Digital PDF','Title Page Top-Banner Color'=>'Título Página Top-Banner Color','Image used at the top of the background on the title page.'=>'Imagen utilizada en la parte superior del fondo en la página de título.','Background Color'=>'Color de fondo','A gradient between this color and white will be used in the page backgrounds'=>'Se utilizará un degradado entre este color y blanco en los fondos de página','Organization Name'=>'Nombre de la organización','Shown in the title page. Eg "Institute of Print My Blog"'=>'Se muestra en la página de título. Por ejemplo, "Instituto de Impresión Mi Blog"','Background Embellishment'=>'Embellecimiento de fondo','Faded image used as a full-page background on the title page, and next to the page number on numbered pages.'=>'Imagen descolorida utilizada como fondo de página completa en la página de título y junto al número de página en las páginas numeradas.','Issue'=>'Edición','Text that appears at the top-right of the cover'=>'Texto que aparece en la parte superior derecha de la portada','ByLine'=>'firma','Project Author(s)'=>'Autor(es) del proyecto(s)','Date Issued'=>'Fecha de emisión','Text that appears under the byline'=>'Texto que aparece bajo la línea de fondo','Coverpage Preamble'=>'Preámbulo de portada','Explanatory text that appears at the bottom of the cover page'=>'Texto explicativo que aparece en la parte inferior de la portada','Mayer Digital PDF'=>'Mayer Digital PDF','Each Post Begins on a New Page'=>'Cada publicación comienza en una nueva página','Browser support for pagebreaks on columns is typically not very good.'=>'La compatibilidad del navegador con saltos de página en columnas no suele ser muy buena.','Whether to force posts to always start on a new page. Doing so makes the page more legible, but uses more paper.'=>'Si forzar que las publicaciones siempre comiencen en una nueva página. Si lo hace, la página es más legible, pero usa más papel.','Show Post Header inside Columns'=>'Mostrar encabezado de poste dentro de columnas','Check this to make post header information, like title, date, author, etc, appear inside columns; uncheck this to have it take up the full page width'=>'Compruebe esto para hacer que la información del encabezado de la publicación, como el título, la fecha, el autor, etc., aparezca dentro de las columnas; desmarcar esto para que tome el ancho de página completo','Show a Dividing Line Between Posts'=>'Mostrar una línea divisoria entre publicaciones','Full-Column Images'=>'Imágenes de columna completa','Resizes images to be the full column width (except ones with the CSS class "mayer-no-resize")'=>'Redimensiona las imágenes para que sean el ancho completo de la columna (excepto las de la clase CSS "mayer-no-resize")','Remove Extra Columns'=>'Eliminar columnas adicionales','Forces your content to only use two columns, even if the content itself was divided into more columns (eg using the "Columns" block)'=>'Obliga a su contenido a usar solo dos columnas, incluso si el contenido en sí se dividió en más columnas (por ejemplo, mediante el bloque "Columnas")','Byline'=>'Autor','Project author(s)'=>'Autor(es) del proyecto(s)','Classic ePub'=>'ePub Classico','Convert Videos to Images and Links'=>'Convertir videos en imágenes y enlaces','Some eReaders don\'t show videos, in which case you may prefer to replace them with an image and a hyperlink to the online video content.'=>'Algunos eReaders no muestran videos, en cuyo caso es posible que prefiera reemplazarlos con una imagen y un hipervínculo al contenido de video en línea.','Title page and Part Header Font Size'=>'Tamaño de fuente de encabezado y encabezado de pieza','Font size used for the default title page’s and part’s header (all other headers’ sizes are derived from the main font size). Use any recognized %1$sCSS font-size keyword%2$s (like "large", "medium", "small") or a %3$slength in any units%2$s (eg "14pt", "50%%", or "10px").'=>'Tamaño de fuente utilizado para el encabezado de la página de título y la pieza predeterminada (todos los tamaños de todos los demás encabezados se derivan del tamaño de fuente principal). Utilice cualquier palabra clave de tamaño de fuente %1$sCSS reconocida%2$s (como "grande", "medio", "pequeño") o una %3$slength en cualquier unidad%2$s (por ejemplo, "14pt", "50%%" o "10px").','Custom Header Font'=>'Tipografía Subida','Default font to use for headers of articles, parts, etc. Font files with extension "ttf" work with most eBook readers. Leave blank to use the default font.'=>'Fuente predeterminada para encabezados de artículos, piezas, etc. Los archivos de fuentes con extensión "ttf" funcionan con la mayoría de los lectores de libros electrónicos. Deje en blanco para usar la fuente predeterminada.','Font Size'=>'Tamaño de fuente','Use any recognized %1$sCSS font-size keyword%2$s (like "large", "medium", "small") or a %3$slength in any units%2$s (eg "14pt", "50%%", or "10px").'=>'Utilice cualquier palabra clave de tamaño de fuente %1$sCSS reconocida%2$s (como "grande", "medio", "pequeño") o una %3$slength en cualquier unidad%2$s (por ejemplo, "14pt", "50%%" o "10px").','Custom Font'=>'Tipografía Personalizado','Default font used in paragraphs, lists, tables, captions, etc. Font files with extension "ttf" work with most eBook readers. Leave blank to use the default font.'=>'Fuente predeterminada utilizada en párrafos, listas, tablas, subtítulos, etc. Los archivos de fuentes con extensión "ttf" funcionan con la mayoría de los lectores de libros electrónicos. Deje en blanco para usar la fuente predeterminada.','File name'=>'Nombre del archivo','Description'=>'Descripción','Shown as eBook metadata.'=>'Se muestra como metadatos de libros electrónicos.','Cover Image'=>'Imagen de portada','Cover image used on eBook file (does not necessarily appear inside project). Ideal dimensions are 2,560 x 1,600 pixels.'=>'Imagen de portada utilizada en el archivo del libro electrónico (no aparece necesariamente dentro del proyecto)','Classic Word'=>'Word clásica','Headers and Footers'=>'Cabeceras y pies de página','Document Header on First Page'=>'Encabezado del documento en la primera página','Content to appear in top margin area but only on the first page.'=>'Contenido que aparecerá en el área del margen superior, pero solo en la primera página.','Document Header on Subsequent Pages'=>'Encabezado de documento en páginas siguientes','Content to appear in top margin area on all pages except the first page.'=>'Contenido que aparecerá en el área del margen superior en todas las páginas excepto en la primera página.','Document Footer'=>'Pie de página del documento','Content to appear in bottom margin area.'=>'Contenido de cada publicación para imprimir.','Some Word Processors don\'t show videos, in which case you may prefer to replace them with an image and a hyperlink to the online video content.'=>'Algunos procesadores de texto no muestran videos, en cuyo caso quizás prefiera reemplazarlos con una imagen y un hipervínculo al contenido del video en línea.','Maximum Image Height (in pixels)'=>'Altura máxima de imagen (en píxeles)','Larger images will be resized to this, smaller images will be unchanged.'=>'Las imágenes más grandes se cambiarán de tamaño a esto, las imágenes más pequeñas se cambiarán.','Leave as hyperlink to website'=>'Dejar como hipervínculo al sitio web','Leave as hyperlink to document'=>'Dejar como hipervínculo al documento','Leave as hyperlink'=>'Dejar como hipervínculo','Haller Tabloid Print PDF'=>'Haller Tabloide Imprimir PDF','Logo image to show on the front page and in the header of subsequent pages. Leave