ou like.'=>'Se muestra en la página de título debajo del subtítulo. Podría ser la URL de tu sitio web, o cualquier otra cosa que te guste.','Site URL'=>'URL del sitio','Date Printed'=>'Fecha de Impresión','Title Page Content'=>'Contenido de la página de título','Post Title'=>'Título de la publicación','ID'=>'ID','Author'=>'Autor','Published Date'=>'Fecha de publicación','Categories and Tags'=>'Categorías y Etiquetas','URL'=>'URL','Featured Image'=>'Imagen destacada','Excerpt'=>'Extracto','Custom Fields'=>'Campos personalizados','Content'=>'Contenido','Post Content'=>'Contenido de la entrada','Content from each post to print.'=>'Contenido de cada publicación para imprimir.','Image & Block Settings'=>'Ajustes de imagen y Blocks','Page Settings'=>'Configuración de página','Page Width'=>'Ancho de página','Not supported by some browsers'=>'No es compatible con algunos navegadores','Use standard %1$sCSS units%2$s'=>'Utilice unidades %1$sCSS estándar%2$s','Page Height'=>'Altura Página','Your theme, "%1$s", can be used in conjunction with your design. Themes are often not intended for print and can conflict with the design, but you may have content that looks broken without the theme.'=>'Su tema, "%1$s", se puede utilizar junto con su diseño. Los temas a menudo no están destinados a la impresión y pueden entrar en conflicto con el diseño, pero es posible que tenga contenido que se vea roto sin el tema.','Note: this option is only supported for the business license.'=>'Nota: esta opción solo se admite para la licencia de negocio.','Don’t Change Image Quality'=>'No cambies la calidad de imagen','%s pixels wide'=>'%s píxeles de ancho','Full Size (on web)'=>'Tamaño completo (en la web)','Uploaded Size (largest possible)'=>'Tamaño cargado (el más grande posible)','Image Quality (in pixels)'=>'Altura máxima de imagen (en píxeles)','Lower quality means smaller file size, whereas higher quality means higher resolution images. Note: if images are missing from the generated PDF, the requested image size might not be available. Use the %1$s Regenerate Thumbnails plugin%2$s to create the missing image sizes.'=>'Una calidad más baja significa un tamaño de archivo más pequeño, mientras que una mayor calidad significa imágenes de mayor resolución. Nota: si faltan imágenes en el PDF generado, es posible que el tamaño de imagen solicitado no esté disponible. Utilice el complemento %1$s Regenerate Thumbnails%2$s para crear los tamaños de imagen que faltan.','Apply Website Theme'=>'Aplicar tema del sitio web','Custom CSS'=>'CSS personalizado','Styles to be applied only when printing projects using this design.'=>'Los estilos solo se aplicarán al imprimir proyectos con este diseño.','Add "Powered By"'=>'Añadir "Powered By"','In compliance with WordPress.org guidelines, not added when printing from your browser.'=>'De acuerdo con las pautas de WordPress.org, no se agrega al imprimir desde su navegador.','Instructs the Pro PDF Service to add "Powered by Print My Blog Pro & WordPress" to your project. Does not appear when printing using your browser.'=>'Indica al Servicio de Impresión Pro que agregue "Powered by Print My Blog Pro &WordPress" en el pie de página de la primera página. No aparece al imprimir con el navegador.','Page Reference Text'=>'Texto de referencia de página','Text to use when replacing a hyperlink with a page reference. "%s" will be replaced with the page number.'=>'Texto que se usará al reemplazar un hipervínculo por una referencia de página. "%s" se reemplazará por el número de página.','(see page %s)'=>'(ver página %s)','You must include "%s" in the page reference text so we know where to put the page number.'=>'Debe incluir "%s" en el texto de referencia de la página para que sepamos dónde colocar el número de página.','Internal Footnote Text'=>'Texto de la nota al pie','Text to use when replacing a hyperlink with a footnote. "%s" will be replaced with the page number.'=>'Texto que se usará al reemplazar un hipervínculo por una referencia de página. "%s" se reemplazará por el número de página.','See page %s.'=>'(ver página %s)','You must include "%s" in the footnote text so we know where to put the URL.'=>'Debe incluir "%s" en el texto de la nota al pie para que sepamos dónde colocar la DIRECCIÓN URL.','External Footnote Text'=>'Texto de la nota al pie','Text to use when replacing a hyperlink with a footnote. "%s" will be replaced with the URL'=>'Texto que se usará al reemplazar un hipervínculo por un foonote. "%s" será reemplazado por la URL','See %s.'=>'Véase %s.','None'=>'Ninguno','Center'=>'Centro','Default Image Alignment'=>'Alineación de imagen predeterminada','Images normally default to "no alignment", which can look jumbled in printouts. Usually it’s best to automatically switch those to align to the center.'=>'Las imágenes normalmente no tienen "ninguna alineación", que puede parecer confusa en las impresiones. Por lo general, lo mejor es cambiarlos automáticamente para alinearlos con el centro.','Don’t move'=>'No te muevas','Snap to the top or bottom of the page'=>'Ajustar a la parte superior o inferior de la página','Only snap if it would otherwise cause a page break'=>'Sólo ajustar si la imagen causaría un salto de página','Resize images if they don’t fit on the page'=>'Cambiar el tamaño de las imágenes si no caben en la página','Image and Block Placement'=>'Colocación de imagen y blocks','Image snapping and dynamic resizing only works using the Pro PDF Service.'=>'El ajuste de imágenes y el cambio de tamaño dinámico solo funcionan con Pro Print.','To reduce whitespace around images, galleries, and tables, Print My Blog can adjust the placement of your content, or resize it according to the space on the page.'=>'Para reducir el espacio en blanco alrededor de las imágenes, Imprimir mi blog puede mover imágenes en su contenido.','Minimum Image Size (in pixels)'=>'Altura máxima de imagen (en píxeles)','Any images larger than this may be resized to fit onto the page, but they will be no smaller than this size.'=>'Cualquier imagen más grande que esto puede cambiarse de tamaño para que quepa en la página, pero no será más pequeña que este tamaño.','Add QR Code to Videos'=>'Agregar código QR a los videos','After a video is converted into a screenshot and URL, you can optionally add a QR code that readers can scan with their phones to view the video.'=>'Después de convertir un video en una captura de pantalla y una URL, opcionalmente puede agregar un código QR que los lectores pueden escanear con sus teléfonos para ver el video.','Arial'=>'Arial','Courier New'=>'Courier Nuevo','Georgia'=>'Georgia','Impact'=>'Impact','Lucida Console'=>'Consola Lucida','Palatino Linotype'=>'Linotipo palatino','Tahoma'=>'Tahoma','Times New Roman'=>'Times New Roman','Verdana'=>'Verdana','Custom Font...'=>'Tipografía Personalizado...','Header Font'=>'Fuente de cabecera','Default font for header tags'=>'Fuente predeterminada para etiquetas de encabezado','Specify the URL of a custom font file, or upload one. The formats "wff" and "wff2" work best, but "ttf" and "otf" also work.'=>'Especifique la dirección URL de un archivo de fuente personalizado o cargue una. Los formatos "wff" y "wff2" funcionan mejor, pero "ttf" y "otf" también funcionan.','Font'=>'Fuente','Default font used in paragraphs, bulleted lists, tables, etc.'=>'Fuente predeterminada utilizada en párrafos, listas de viñetas, tablas, etc.','A simple but flexible design intended mainly for reading from screens, inspired by Print My Blog Quick Print.'=>'Un diseño sencillo pero flexible destinado principalmente a la lectura desde pantallas, inspirado en Print My Blog Free.','Title page, with working hyperlinks.'=>'Página de título, con hipervínculos de trabajo.','Main matter, showing hyperlinks and large images.'=>'Asunto principal, mostrando hipervínculos e imágenes grandes.','Editorial Review'=>'Revisión editorial','Your writing in an easy-to-review format for editors.'=>'Su escritura en un formato fácil de revisar para los editores.','Title page, showing the double-spaced text.'=>'Página de título, que muestra el texto espaciado doble.','Main matter, showing smaller images and double-spaced text.'=>'Asunto principal, que muestra imágenes más pequeñas y texto espaciado doble.','Classic Print PDF'=>'PDF de impresión clásica','A simple but flexible design intended for printing, inspired by Print My Blog Quick Print'=>'Un diseño sencillo pero flexible destinado a la impresión, inspirado en Print My Blog Free','Title page, showing removed hyperlinks.'=>'Página de título, que muestra los hipervínculos eliminados.','Main matter, showing external hyperlinks automatically converted into footnotes. Page numbers are always on the bottom-outside corner, and each article’s title is shown at the top of right pages.'=>'Asunto principal, que muestra hipervínculos externos convertidos automáticamente en notas al pie de página. Los números de página siempre están en la esquina inferior exterior y el título de cada artículo se muestra en la parte superior de las páginas derechas.','Economical Print PDF'=>'PDF de impresión económica','Compact design meant to save paper but still deliver all the content.'=>'Diseño compacto destinado a guardar papel, pero aún así entregar todo el contenido.','Title page, showing smaller text.'=>'Página de título, que muestra texto más pequeño.','Main matter, showing smaller text and images to reduce ink usage.'=>'Asunto principal, que muestra texto e imágenes más pequeños para reducir el uso de tinta.','Buurma Whitepaper'=>'Papel blanco buurma','Stylized and branded PDF designed mainly for reading from a device, great for organizations'=>'PDF estilizado y de marca diseñado principalmente para leer desde un dispositivo, ideal para organizaciones','Title page, showing a stylzed upper margin for a company name, background gradient and logo, among other things.'=>'Portada, que muestra un margen superior estilizado para el nombre de una empresa, degradado de fondo y logotipo, entre otras cosas.','Main matter, showing working hyperlinks (which also each get an automatic footnote), and page number and logo in bottom-right corner.'=>'Asunto principal, que muestra hipervínculos de trabajo (que también cada uno obtiene una nota a pie de página automática), y el número de página y el logotipo en la esquina inferior derecha.','Issue 01'=>'Número 01','Text explaining the purpose of the paper and gives a brief summary of it, so folks know they’re reading the right thing.'=>'Texto explicando el propósito del periódico y da un breve resumen de él, para que la gente sepa que están leyendo lo correcto.','Mayer Magazine'=>'Revista Mayer','Digital 2-column magazine inspired by the defunct Zinepal'=>'Revista digital de 2 columnas inspirada en el desaparecido Zinepal','Title page and table of contents both fit on the first page.'=>'La página de título y la tabla de contenido caben en la primera página.','Two column layout which compactly shows content and images.'=>'Diseño de dos columnas que muestra compactamente contenido e imágenes.','Simple ePub for using when uploading as an eBook to Amazon and other epub marketplaces'=>'ePub simple para usar cuando se carga como libro electrónico en Amazon y otros mercados de epub','Simple Microsoft Word document when that format is required.'=>'Documento simple de Microsoft Word cuando se requiere ese formato.','Title page and table of contents.'=>'Portada y tabla de contenidos.','Simple layout'=>'Diseño sencillo','Haller Tabloid'=>'Tabloide Haller','Print-ready newspaper design'=>'Diseño de periódico listo para imprimir','Digital PDF'=>'Digital PDF','PDF file intended for viewing on a computer, tablet or phone, but not necessarily for printing to paper. Usually includes working hyperlinks, ample colors, and other features that require a device.'=>'Pdf destinado a su visualización en un ordenador, tableta o teléfono, pero no necesariamente para imprimir en papel. Por lo general, incluye hipervínculos de trabajo, colores amplios y otras características que requieren un dispositivo.','Print-Ready PDF'=>'PDF listo para imprimir','PDF file intended for printing on your home printer or with a printer service. Usually removes hyperlinks, avoids excessive ink use, and are designed for viewing the 2-page spread (using the front and back of a page).'=>'PDF destinado a imprimir en su impresora doméstica o con un servicio de impresora. Por lo general, elimina los hipervínculos, evita el uso excesivo de tinta y está diseñado para ver el pliego de 2 páginas (utilizando la parte frontal y trasera de una página).','eBook (ePub)'=>'Libro electrónico (ePub)','ePub file intended for reading from an eReader, tablet, or phone; or for publishing on an eBook marketplace like Amazon\'s Kindle Direct Publishing, Apple Books, or Kobo.'=>'Archivo ePub destinado a leer desde un eReader, tableta o teléfono; o para publicar en un mercado de libros electrónicos como Kindle Direct Publishing de Amazon, Apple Books o Kobo.','Create unlimited ePubs with any purchase.'=>'Crea ePubs ilimitados con cualquier compra.','Word Document'=>'Documento de Word','File editable in Microsoft Word, Google Docs, and LibreOffice (not Apple\'s Pages app, unfortunately). Useful for sharing persons and programs that require a ".doc" file. Word Documents typically require manual formatting in your chosen Word Processor.'=>'Archivo editable en Microsoft Word, Google Docs, LibreOffice, etc. Útil para compartir personas y programas que requieren un archivo ".doc". Los documentos de Word generalmente requieren formato manual en el procesador de textos elegido.','Create unlimited Word Documents with a Pro Plan.'=>'Cree documentos de Word ilimitados con un plan Pro.','About Quick Print'=>'Acerca de la impresión rápida','This is the quick-and-easy option, best for making printouts for your own records. For something more professional and full-featured, use %1$sPro Print%2$s. It has free and paid options. %3$sSee full feature comparison.%2$s'=>'Esta es la opción rápida y fácil, mejor para hacer impresiones para sus propios registros. Para algo más profesional y con todas las funciones, utilice %1$sPro Print%2$s. Tiene opciones gratuitas y de pago. %3$s Consulte comparación completa de características. %2$s','About Pro Print'=>'Acerca de Pro Print','Pro Print is the best way to make professional-quality documents. You will be able to print them for free using your browser, or upgrade to use Print My Blog Pro\'s full features. %1$sSee full feature comparison.%2$s'=>'Pro Print es la mejor manera de hacer documentos de calidad profesional. Podrás imprimirlos de forma gratuita con tu navegador o actualizar para usar las funciones completas de Print My Blog Pro. %1$s Consulte comparación completa de características. %2$s','If you just want something quick, use %1$sQuick Print%2$s instead.'=>'Si solo quieres algo rápido, usa %1$sQuick Print%2$s en su lugar.','Project Designs are like WordPress Themes'=>'Los diseños de proyectos son como temas de WordPress','Each has a different look and options that can be customized.'=>'Cada uno tiene un aspecto y opciones diferentes que se pueden personalizar.','The "Classic" design is the most similar Print My Blog’s Quick Print, so it’s a good default choice.'=>'El diseño "Clásico" es la impresión rápida más similar de Print My Blog, por lo que es una buena opción predeterminada.','Click on the preview image for more details, and feel free to come back to this page later if you want to try a different design.'=>'Haga clic en la imagen de vista previa para obtener más detalles y no dude en volver a esta página más adelante si desea probar un diseño diferente.','Read the User Guide'=>'Lea la Guía del usuario','Each Design has Different Options and is Reusable'=>'Cada diseño tiene diferentes opciones y es reutilizable','Below are your chosen design’s customization options.'=>'A continuación se muestran las opciones de personalización del diseño elegido.','If you don’t see an option you need, you may want to go back and choose a different design, or ask the design’s author for it.'=>'Si no ves una opción que necesitas, es posible que quieras volver y elegir un diseño diferente, o pedirle al autor del diseño que lo haga.','Note: designs are reused between projects. So customizations to this design will be reused by other projects using this same design'=>'Nota: los diseños se reutilizan entre proyectos. Así que las personalizaciones de este diseño serán reutilizadas por otros proyectos utilizando este mismo diseño','How to Edit Project Content'=>'Cómo editar el contenido del proyecto','Find the articles (posts, pages, other post types) from WordPress you want to add on the left, and add it to your project on the right by dragging'=>'Encuentra los artículos (publicaciones, páginas, otros tipos de publicaciones) de WordPress que quieres agregar a la izquierda, y añádelo a tu proyecto a la derecha arrastrando','Title Page and Table of Contents print materials are automatically added to each project, but you can remove or %1$scustomize them%2$s.'=>'Los materiales de impresión de la página de título y la tabla de contenido se agregan automáticamente a cada proyecto, pero puede eliminarlos o %1$spersonalizarlos%2$s.','Place articles in either front matter, body, or back matter, according to how you want your project organized. Each design can style them differently (eg front matter is often is numbered with roman numerals)'=>'Coloque artículos en la materia frontal, la materia principal o la materia de fondo, de acuerdo con cómo desea que su proyecto se organice. Cada diseño puede aplicarles un estilo diferente (por ejemplo, la materia frontal a menudo está numerada con números romanos)','Nest content inside others to create parts'=>'Anida contenido dentro de otros para crear piezas','Read the User Guide on how to edit your project\'s content.'=>'Lea la Guía del usuario sobre cómo editar el contenido de su proyecto.','Everything Else About Your Project is Stored Here'=>'Todo lo demás sobre su proyecto se almacena aquí','Different formats and designs may require other information about your project.'=>'Diferentes formatos y diseños pueden requerir otra información sobre su proyecto.','Some examples of metadata are: title page info, file info, or copyright data.'=>'Algunos ejemplos de metadatos son: información de la página de título, información de archivo o datos de derechos de autor.','So although your choice of design may affect what metadata is required, it is not shared with other projects.'=>'Por lo tanto, aunque su elección de diseño puede afectar a los metadatos necesarios, no se comparte con otros proyectos.','Generate and View Your File'=>'Generar y ver su archivo','Your project is ready to be generated! Clicking "Generate" will compile your content into a print-page.'=>'¡Su proyecto está listo para ser generado! Al hacer clic en "Generar", se compilará el contenido en un documento. A continuación, haga clic en "ver".','Read the User Guide on %1$supdating%2$s, %3$sgenerating the pro file%2$s, and %4$sgetting help%2$s.'=>'Lea la Guía del usuario sobre %1$supdating%2$s, %3$sgenerar el archivo pro%2$s y %4$sla ayuda%2$s.','Posts just for Print My Blog'=>'Publicaciones sólo para Imprimir mi blog','Print My Blog "Print Materials" are like private posts. They aren’t visible to site visitors, but you can use them in your Pro Print Projects.'=>'Imprimir mi blog "Materiales de impresión" son como publicaciones privadas. No son visibles para los visitantes del sitio, pero puedes usarlos en tus proyectos de impresión pro.','Title Page'=>'Página de título','Table of Contents'=>'Taula de continguts','Single Column'=>'Una Columna','Fullpage Content'=>'Contenido de página completa','Centered Content'=>'Contenido centrado','Full Column Content'=>'Contenido de página completa','Important'=>'Importante','Print'=>'Imprimir','Print 🖨'=>'Imprimir 🖨','PDF'=>'PDF','PDF 📄'=>'PDF 📄','eBook'=>'PDF','eBook 📱'=>'📱 de libros electrónicos','Invalid format "%s".'=>'Formato no válido "%s".','Site Title'=>'Título del sitio','Tagline'=>'Lema','Filters Used'=>'Filtros utilizados','E.g. selected categories, taxonomies, and date range.'=>'Por ejemplo, categorías seleccionadas, taxonomías y intervalo de fechas.','Credit Print My Blog Plugin'=>'Crédito Imprimir mi blog Plugin','Show some love and tell your readers about Print My Blog %1$s'=>'Mostrar un poco de amor y contar a sus lectores acerca de Imprimir mi blog %1$s','Extra dividing line at end of post'=>'Línea divisoria adicional al final del poste','1'=>'1','2'=>'2','3'=>'3','The number of columns of text on each page. Not supported by some web browsers.'=>'El número de columnas de texto en cada página. No es compatible con algunos navegadores web.','Pro Print lets you specify header and text size and font'=>'Pro Print le permite especificar el tamaño y la fuente del encabezado y el texto','Tiny (1/2 size)'=>'Diminuto (tamaño 1/2)','Small (3/4 size)'=>'Pequeño (tamaño 3/4)','Normal (theme default)'=>'Normal (valor predeterminado del tema)','Large (slightly larger than normal)'=>'Grande (ligeramente más grande de lo normal)','Image Size'=>'Tamaño de imagen','Full (theme default)'=>'Completo (valor predeterminado del tema)','Large (3/4 size)'=>'Grande (tamaño 3/4)','Medium (1/2 size)'=>'Medio (tamaño 1/2)','Small (1/4 size)'=>'Pequeño (tamaño 1/4)','None (hide images)'=>'Ninguno (ocultar imágenes)','If you want to save paper, choose a smaller image size, or hide images altogether.'=>'Si desea guardar papel, elija un tamaño de imagen más pequeño u oculte imágenes por completo.','Include Hyperlinks'=>'Incluir hipervínculos','Pro Print with Pro PDF Service supports changing hyperlinks to page references or footnotes'=>'Pro Print with Pro PDF Service admite el cambio de hipervínculos a referencias de página o notas al pie','Include'=>'Incluir','Replace with URL in Parenthesis'=>'Reemplazar por URL en paréntesis','Note: PDFs generated in Firefox and Safari automatically remove hyperlinks. If you want your PDF to include hyperlinks, please use another browser.'=>'Nota: Los archivos PDF generados en Firefox y Safari eliminan automáticamente los hipervínculos. Si desea que su PDF incluya hipervínculos, utilice otro navegador.','Post Rendering Wait-Time'=>'Después de renderizar el tiempo de espera','ms'=>'ms','Milliseconds to wait between rendering posts. If posts are rendered too quickly on the page, sometimes images won’t load properly. '=>'Milisegundos para esperar entre las publicaciones de representación. Si las publicaciones se representan demasiado rápido en la página, a veces las imágenes no se cargan correctamente. ','Include Inline Javascript'=>'Incluir Javascript en línea','Sometimes posts contain inline javascript which can cause errors and stop the page from rendering.'=>'A veces las publicaciones contienen javascript en línea que puede causar errores y detener la representación de la página.','Include Unrendered Shortcodes'=>'Incluir shortcodes sin remitente','If you left shortcodes from deactivated deactivated plugins or themes in your posts, they are automatically removed from printouts. Check this to leave them.'=>'Si dejaste shortcodes de plugins o temas desactivados desactivados en tus publicaciones, se eliminan automáticamente de las impresiones. Mira esto para dejarlos.','article'=>'articulo','part'=>'dividir','volume'=>'Volum','anthology'=>'antología','No generator class specified for format "%s"'=>'No se especificó ninguna clase de generador para el formato "%s"','Setup'=>'Configuración','Choose %s Design'=>'Elija %s Diseño','Customize %s Design'=>'Personalizar el diseño de %s','Edit Content'=>'Editar Contenido','Edit Metadata'=>'Editar metadatos','Generate Print Page'=>'Generar página de impresión','The design with slug "%s" should exist but doesn\'t. Check the plugin that added that design is still active (and if it required a subscription, that the subscription is stil