e you sure you want to reset the settings back to defaults?'=>'¿Está seguro de que desea restablecer la configuración de nuevo a los valores predeterminados?','Reset to Defaults'=>'Reestablecer los Valores por Defecto','Print My Blog - Quick Print'=>'Imprimir mi blog - Impresión rápida','Configure how you’d like the blog to be printed, or just use our recommended defaults.'=>'Configure cómo desea que se imprima el blog o simplemente use nuestros valores predeterminados recomendados.','Site URL (including "https://" or "http://")'=>'URL del sitio (incluidos "https://" o "http://")','URL of the WordPress site (self-hosted or on WordPress.com) you’d like to print. Leave blank to use this current site.'=>'URL del sitio de WordPress (autohospedado o en WordPress.com) que desea imprimir. Deje en blanco para usar este sitio actual.','Paper'=>'Papel','Print a physical copy using your web browser’s print functionality.'=>'Imprima una copia física con la funcionalidad de impresión de su navegador web.','Make a PDF file, intended for reading from a computer or other device, using your browser or a browser extension.'=>'Haga un archivo PDF, destinado a leer desde un ordenador u otro dispositivo, utilizando su navegador o una extensión de navegador.','eBook (ePub or MOBI)'=>'Libro electrónico (ePub o MOBI)','Make a free eBook using dotEPUB.'=>'Haga un libro electrónico gratuito con dotEPUB.','HTML'=>'HTML','Easily copy-and-paste into another program like Microsoft Word or Google Docs. Note: this is not recommended for customizing printouts, as other programs usually format the content poorly. Instead, use Print My Blog’s CSS classes to remove or add content from printouts.'=>'Copie y pegue fácilmente en otro programa como Microsoft Word o Google Docs. Nota: esto no se recomienda para personalizar las impresiones, ya que otros programas suelen dar formato al contenido mal. En su lugar, utilice imprimir las clases CSS de mi blog para eliminar o agregar contenido de las impresiones.','Learn More'=>'Aprende más','Show More Print Options'=>'Mostrar más opciones de impresión','Options'=>'Opciones','Post Selection'=>'Selección de artículo','Pro Print supports custom post types, combining posts with pages, and print-only materials'=>'Print Print admite tipos de publicaciones personalizados, combinando publicaciones con páginas y materiales solo para imprimir','Order'=>'Orden','Pro Print supports drag-and-drop ordering of content.'=>'Pro Print admite el orden de arrastrar y soltar de contenido.','Posts will be ordered:'=>'Se ordenarán publicaciones:','Oldest First'=>'Antiguos Primero','Newest First'=>'Nuevos primero','Pages will be ordered using the "Order" attribute:'=>'Las páginas se ordenarán mediante el atributo "Pedido":','From Lowest to Highest'=>'De más bajo a más alto','From Highest to Lowest'=>'De más alto a más bajo','Password-Protected'=>'Protegido con contraseña','Statuses'=>'Estados','Filters'=>'Filtros','Pro Print supports filtering by custom taxonomies.'=>'Pro Print admite páginas de título de página completa, páginas de título personalizadas o ninguna página de título','Authored By'=>'Escrito por','Posted After (and Including)'=>'Publicado después (e incluyendo)','Posted Before (and Including)'=>'Publicado antes (e incluyendo)','Prepare Print-Page'=>'Preparar la página de impresión','It’s finally here...'=>'Por fin está aquí...','Print My Blog – Pro Print!'=>'Imprimir mi blog — Pro Print','The old features are still here: "Print Now" was just renamed "Quick Print", and the Print Buttons are still available under "Settings".'=>'Las características antiguas todavía están aquí: "Imprimir ahora" acaba de cambiar el nombre de "Impresión rápida", y los botones de impresión todavía están disponibles en "Configuración".','Pro Print makes more functional and visually-appealing PDFs using your web browser for free, or the new paid Pro PDF Service.'=>'Pro Print hace que los archivos PDF más funcionales y visualmente atractivos utilicen su navegador web de forma gratuita, o el nuevo servicio de impresión Pro de pago.','Automatic Table of Contents'=>'Tabla automática de contenidos','Add a table of contents to your project, with links and page numbers.'=>'Agregue una tabla de contenido al proyecto, con vínculos y números de página.','Pro PDF Service adds page numbers.'=>'Servicio de impresión Pro','Automatic page references and footnotes'=>'Convertir automáticamente hipervínculos en referencias de página y notas al pie','Hyperlinks can be automatically converted into references to the page the linked-to content is located, or a footnote with the web address print-out.'=>'Los hipervínculos se pueden convertir automáticamente en referencias a la página en la que se encuentra el contenido vinculado o en una nota al pie con la impresión de la dirección web.','Proper margins, page numbers and running heads'=>'Márgenes adecuados, números de página y cabezas de carrera','Clean margins, alternating page numbers, roman numerals for front matter, running chapter heads, and more.'=>'Limpie los márgenes, alternando números de página, números romanos para la materia frontal, ejecutando cabezas de capítulo y más.','Support Custom Post Types'=>'Admite tipos de publicación personalizados','Content from other plugins, like WooCommerce Products, or your LMS\'s course materials, can be included in projects.'=>'El contenido de otros plugins, como WooCommerce Products o los materiales del curso de tu LMS, se puede incluir en proyectos.','Drag-and-Drop Content Organizer'=>'Arrastrar y soltar contenido en proyectos','Drop posts, pages, and other post types into projects in any order. Even organize them into parts.'=>'Coloque publicaciones, páginas y otros tipos de publicaciones en proyectos en cualquier orden. Incluso organizarlos en partes.','Premade, Reusable, Customizable Designs'=>'Diseños prefabricados, reutilizables y personalizables','Print My Blog\'s Designs are like WordPress Themes: each has its own look and customization options. Reuse the same design across projects. Or even create your own design using HTML, CSS, and Javascript'=>'Los diseños de Mi blog son como temas de WordPress: cada uno tiene su propio aspecto y opciones de personalización. Reutilizar el mismo diseño en todos los proyectos. O incluso crear su propio diseño usando HTML, CSS y Javascript','Pro PDF Service lets designs fully control the margins, page backgrounds, and los of other aspects.'=>'Pro PDF Service permite a los diseños controlar completamente los márgenes, los fondos de página y la pérdida de otros aspectos.','Saveable Projects'=>'Generar proyecto','Save where you left off.'=>'Guarda donde lo dejaste.','Front matter, back matter, parts, and print materials'=>'Materia frontal, materia posterior, piezas y materiales de impresión','Add front and back matter to books, organize the content into parts, and add special "print material" posts to use only in your projects'=>'Agregue materia frontal y posterior a los libros, organice el contenido en partes y agregue publicaciones especiales de "material de impresión" para usarlas solo en sus proyectos','Features Include:'=>'Imagen destacada','Try Pro Print Now'=>'Pro impresión','Learn More on printmy.blog'=>'Más información sobre printmy.blog','Please %1$slet me know%2$s if you have any questions!'=>'Por favor, %1$s déjame saber%2$s si tienes alguna pregunta!','Best wishes, Mike Nelson, Print My Blog Developer'=>'Mis mejores deseos, Mike Nelson, Print My Blog Developer','Welcome to %s!'=>'Bienvenido a %s!','Print My Blog Pro'=>'Print My Blog Pro','What would you like to do?'=>'¿Qué te gustaría hacer?','Print My Blog Now for Free'=>'Imprima mi blog ahora gratis','Use Quick Print'=>'Usar impresión rápida','2 clicks to printing'=>'2 clics para imprimir','No watermark'=>'Sin marca de agua','Print Thousands of Pages from your Web Browser'=>'Imprima miles de páginas desde su navegador web','Let Visitors Print My Blog for Free'=>'Deje que los visitantes impriman mi b